import React from "react";

const Card = ({ details }) => {
  return (
    <div id="card">
      <div id="photo">
        <img src={`${details.photo}`} alt="" />
          </div>
          <div id="text">
              <h1>{details}</h1></div>
      </div>
  );
};

export default Card;
